import React,{useState} from "react";
import ProjectCover from "./ProjectCover";
import ProjectInfo from "./ProjectInfo";

function Project({ project }) {
  return (
    <div className="projectsContainer">
      <ProjectCover coverUrl={project.imageCoverUrl} />
      <ProjectInfo image1={project.image1Url} description1={project.image1Desc} image2={project.image2Url} description2={project.image2Desc} image3={project.image3Url} description3={project.image3Desc} />
    </div>
  );
}

export default Project;
